import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError("‚Üí Please enter a URL.");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError("‚Üí Backend not reachable.");
    }

    setLoading(false);
  };

  return (
    <div style={styles.body}>
      <div style={styles.container}>
        <h1 style={styles.title}>üîç Vintage AI Phishing Scanner</h1>

        <input
          type="text"
          placeholder="Type or paste a URL here..."
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          ‚ñ∂ Scan URL
        </button>

        {loading && <p style={styles.loading}>‚åõ Running ML Model...</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.card}>

            <p style={styles.label}>Final Result:</p>
            <div
              style={{
                ...styles.resultBox,
                borderColor:
                  result.final_prediction === "Phishing" ? "#C62828" : "#2E7D32",
                color:
                  result.final_prediction === "Phishing" ? "#C62828" : "#2E7D32",
              }}
            >
              {result.final_prediction}
            </div>

            <p style={styles.text}>
              <b>ML Prediction:</b> {result.ml_prediction}{" "}
              <span style={{ opacity: 0.8 }}>
                {result.ml_prediction === 1 ? "(Phishing)" : "(Legitimate)"}
              </span>
            </p>

            <p style={styles.text}>
              <b>ML Probability:</b>{" "}
              {(result.ml_probability * 100).toFixed(2)}%
            </p>
          </div>
        )}
      </div>
    </div>
  );
}

// ------------------ STYLES ----------------------

const styles = {
  body: {
    backgroundColor: "#F4EBD0",
    minHeight: "100vh",
    padding: "40px 0",
    fontFamily: "'Courier New', monospace",
  },
  container: {
    width: "60%",
    margin: "auto",
    textAlign: "center",
    padding: "25px",
    background: "#FAF3DC",
    border: "3px solid #A67C52",
    borderRadius: "12px",
    boxShadow: "0 0 20px rgba(0,0,0,0.2)",
  },
  title: {
    fontSize: "34px",
    marginBottom: "25px",
    color: "#4E3B2C",
    textShadow: "1px 1px 0 #ffffff",
  },
  input: {
    width: "80%",
    padding: "12px",
    fontSize: "16px",
    background: "#FFF7E3",
    border: "2px solid #B18C6C",
    borderRadius: "6px",
    color: "#4E3B2C",
    outline: "none",
  },
  button: {
    marginLeft: "10px",
    padding: "12px 20px",
    fontSize: "16px",
    cursor: "pointer",
    background: "#A67C52",
    color: "white",
    border: "none",
    borderRadius: "6px",
    boxShadow: "2px 2px 0 #6F4E37",
  },
  loading: { fontSize: 18, color: "#8D6E63", marginTop: 20 },
  error: { fontSize: 18, color: "#C62828", marginTop: 20 },
  card: {
    marginTop: 30,
    padding: "25px",
    background: "#FFF7E3",
    border: "3px solid #A67C52",
    borderRadius: "12px",
    textAlign: "left",
  },
  label: {
    fontSize: "20px",
    fontWeight: "bold",
    color: "#4E3B2C",
  },
  resultBox: {
    fontSize: "26px",
    margin: "10px 0 20px 0",
    padding: "10px",
    border: "3px dashed",
    borderRadius: "8px",
    textAlign: "center",
  },
  text: {
    fontSize: "18px",
    margin: "8px 0",
    color: "#4E3B2C",
  },
};

export default App;
